    )
  return (
    <div className='bg-slate-600 h-20'>
    <div className='bg-slate-700 w-40 h-20 -mt-6' >
        <h1 className='text-white font-bold text-3xl float-left pl-12 pt-4'>LOGO</h1><ul className='float-right'>
      {naviList}
    </ul>
    </div>
    
    </div>
  )
}
